description:
(Review from Amazon) 

By Arturo Rodriguez on March 25, 2013
Amazon Verified Purchase
If you are curious about who made this famous rifle and how to identify the particular make of your rifle this is a must book. It is the most informative book I have ever seen on the subject. Comes with how to identify the different makes and models and manufacturers and serial number information. Try it you will like it,


